            'manage_options',
            'wc-cademi-integration-products',
            array($this, 'display_products')
        );

        add_submenu_page(
            'wc-cademi-integration',
            'Instruções de Configuração',
            'Instruções de Configuração',
            'manage_options',
            'wc-cademi-integration-instructions',
            array($this, 'display_instructions')
        );

        add_submenu_page(
            'wc-cademi-integration',
            'Logs Ensalamento Educpay',
            'Logs Ensalamento Educpay',
            'manage_options',
            'wc-cademi-integration-logs',
            array($this, 'logs_page')
        );

        
    }

    public function create_admin_page() {
        ?>
        <div class="wrap">
            <h1>WC EducPay Integration</h1>
            <img src="data:image/png;base64," alt="Educpay" width="100" height="40"/>
            <p>Preencha os dados conforme disposto nas <a href='admin.php?page=wc-cademi-integration-instructions'>Instruções de Configuração</a>:</p>


            <form method="post" action="options.php">
                <?php
                settings_fields('wc_cademi_integration_group');
                do_settings_sections('wc-cademi-integration-admin');
                submit_button();
                ?>
            </form>
        </div>
        <?php
    }

    // Função para exibir a página de logs
    public function logs_page() {
        ?>
        <div class="wrap">
            <h1>Logs de Integração</h1>
            <div id="logs-accordion">
                <?php $this->display_logs(); ?>
            </div>
        </div>

        <style>
        .accordion-item {
            margin-bottom: 10px;
            border: 1px solid #ddd;
        }
        .accordion-header {
            background: #0073aa;
            color: #fff;
            padding: 10px;
            cursor: pointer;
        }
        .accordion-content {
            display: none;
            background: #f1f1f1;
            padding: 10px;
        }
        </style>

        <script>
        document.addEventListener('DOMContentLoaded', function() {
            const headers = document.querySelectorAll('.accordion-header');
            headers.forEach(header => {
                header.addEventListener('click', function() {
                    const content = this.nextElementSibling;
                    if (content.style.display === 'none' || content.style.display === '') {
                        content.style.display = 'block';
                    } else {
                        content.style.display = 'none';
                    }
                });
            });
        });
        </script>
        <?php
    }


    // Função para exibir os logs
    public function display_logs() {
        global $wpdb;
        $table_name = $wpdb->prefix . 'wc_cademi_logs';
        $logs = $wpdb->get_results("SELECT * FROM $table_name ORDER BY order_id, time DESC");

        $current_order_id = null;
        foreach ($logs as $log) {
            if ($log->order_id !== $current_order_id) {
                if ($current_order_id !== null) {
                    echo '</div></div>'; // Fechar o último item da sanfona
                }
                $current_order_id = $log->order_id;
                echo '<div class="accordion-item">';
                echo '<h3 class="accordion-header">' . esc_html("Pedido #$log->order_id") . '</h3>';
                echo '<div class="accordion-content">';
            }
            echo '<p><strong>' . esc_html($log->time) . ':</strong> ' . esc_html($log->status) . '</p>';
            $response = maybe_unserialize($log->response);
            $status_icon = strpos($response, 'success') !== false ? '✔️' : '❌';
            echo '<p><strong>Resposta do Servidor:</strong> ' . esc_html($response) . ' ' . $status_icon . '</p>';
        }
        if ($current_order_id !== null) {
            echo '</div></div>'; // Fechar o último item da sanfona
        }
    }


