    public function display_products() {
        ?>
        <div class="wrap">
            <h1>Cursos Cadastrados no WooCommerce</h1>
            <p>Utilize o ID do Curso cadastrado no WooCommerce para Cadastrar em seu ambiente de Área de Membros EDUCPAY. (ÁREA DE MEMBROS -> VITRINES -> ENTREGAS)</p>
            <br><br>
            <?php
            $args = array(
                'post_type' => 'product',
                'posts_per_page' => -1,
            );

            $products = get_posts($args);

            if ($products) {
                echo '<table class="wp-list-table widefat fixed striped">';
                echo '<thead>';
                echo '<tr>';
                echo '<th>ID</th>';
                echo '<th>Nome</th>';
                echo '<th>Valor</th>';
                echo '</tr>';
                echo '</thead>';
                echo '<tbody>';

                foreach ($products as $product) {
                    $product_id = $product->ID;
                    $product_name = get_the_title($product_id);
                    $product_price = get_post_meta($product_id, '_price', true);

                    echo '<tr>';
                    echo '<td>' . esc_html($product_id) . '</td>';
                    echo '<td>' . esc_html($product_name) . '</td>';
                    echo '<td>' . esc_html($product_price) . '</td>';
                    echo '</tr>';
                }

                echo '</tbody>';
                echo '</table>';
            } else {
                echo '<p>Não há curso cadastrado no Woocommerce.</p>';
            }
            ?>
        </div>
        <?php
    }

    public function page_init() {
        register_setting(
            'wc_cademi_integration_group', // option_group
            'wc_cademi_integration_url', // option_name
            array($this, 'sanitize') // sanitize_callback
        );

        register_setting(
            'wc_cademi_integration_group', // option_group
            'wc_cademi_integration_token', // option_name
            array($this, 'sanitize') // sanitize_callback
        );

        add_settings_section(
            'wc_cademi_integration_section', // id
            'Configurações', // title
            null, // callback
            'wc-cademi-integration-admin' // page
        );

        add_settings_field(
            'url', // id
            'URL', // title
            array($this, 'url_callback'), // callback
            'wc-cademi-integration-admin', // page
            'wc_cademi_integration_section' // section
        );

        add_settings_field(
            'token', // id
            'Token', // title
            array($this, 'token_callback'), // callback
            'wc-cademi-integration-admin', // page
            'wc_cademi_integration_section' // section
        );
    }

    public function sanitize($input) {
        return sanitize_text_field($input);
    }

    public function url_callback() {
        printf(
            '<input type="text" id="url" name="wc_cademi_integration_url" value="%s" />',
            esc_attr(get_option('wc_cademi_integration_url'))
        );
    }

    public function token_callback() {
        printf(
            '<input type="text" id="token" name="wc_cademi_integration_token" value="%s" />',
            esc_attr(get_option('wc_cademi_integration_token'))
        );
    }
}
